import React from 'react'
import { loginRequest } from '../../AuthenticationFolder/authConfig'
import { callForEvent } from './GraphCalls';
import { useState } from 'react';
import { useEffect } from 'react';

export async function GetEvent (data, instance, accounts){

  const request = {
      ...loginRequest,
      account: accounts[0]
  };  

  const tokenProm = instance.acquireTokenSilent(request);

  data.map((user) => {
    if(user.accountEnabled === true && (user.userPrincipalName.length < 13 
    ) ){
      console.log(user)
    }
  })
  tokenProm.then((response) => {
    return "ehj"
  })
}
